import React from 'react';
import { AppBar, Toolbar, Typography, Tabs, Tab, Box } from '@mui/material';

const sections = [
    { label: 'Dashboard', id: 'overview' },
    { label: 'Tracks', id: 'tracks' },
    { label: 'Artists', id: 'artists' },
    { label: 'Sentiment', id: 'sentiment' },
    { label: 'Recommendations', id: 'recommendations' },
    { label: 'Visualizations', id: 'visualizations' },
];

function TopNavBar({ section, onSectionChange }) {
    return (
        <AppBar position="fixed" color="primary" elevation={2}>
            <Toolbar sx={{ justifyContent: 'space-between' }}>
                <Typography variant="h6" sx={{ fontWeight: 700, letterSpacing: 1 }}>
                    Spotify Wrapped, But Better
                </Typography>
                <Box sx={{ flexGrow: 1, ml: 4 }}>
                    <Tabs
                        value={section}
                        onChange={(_, val) => onSectionChange(val)}
                        textColor="inherit"
                        indicatorColor="secondary"
                        centered
                    >
                        {sections.map((s) => (
                            <Tab key={s.id} label={s.label} value={s.id} sx={{ fontWeight: 600 }} />
                        ))}
                    </Tabs>
                </Box>
            </Toolbar>
        </AppBar>
    );
}

export default TopNavBar;
